E4. \uB9C9\uC0C1 \uD234\uAE4C\uC9C0 \uC124\uCE58\uD558\uACE0, \uAE00\uC744 \uC801\uC73C\uB2C8 \uC660\uC9C0 \uBAA8\uB974\uAC8C \uC798 \uC801\uC5B4\uC57C\uACA0\uB2E4\uB294 \uBD80\uB2F4\uAC10\uC774 \uC0DD\uAE30\uAE30\uB3C4 \uD558\uB2E4. \uC774 \uB188\uC758 \uB9C8\uC74C\uC774\uB780 \uCC38 \uBCC0\uB355\uC774 \uC2EC\uD558\uB2E4."), mdx("p", null, "\uC870\uAE08 \uB354 \uAE4A\uAC8C \uB0B4\uB824\uAC00\uBCF4\uBA74.\n\uB0B4\uAC00 \uC65C \uC774\uB7F0 \uC0DD\uAC01\uC744 \uAC00\uC9C0\uAC8C \uB41C \uAC83\uC77C\uAE4C? \uB098 \uC2A4\uC2A4\uB85C \uC0DD\uAC01\uC744 \uC815\uB9AC\uD558\uACE0 \uD45C\uD604\uD558\uACE0 \uC2F6\uC740 \uC695\uAD6C\uB3C4 \uC788\uC744 \uAC83\uC774\uACE0, \uC544\uBB34 \uAC70\uB9AC\uB08C\uC5C6\uC774 \uB0B4 \uC0DD\uAC01\uC744 \uD480\uC5B4\uB0B4\uACE0 \uC2F6\uC740 \uB9C8\uC74C\uB3C4 \uC788\uB2E4. \uB0B4 \uAE00\uC774 \uB2E4\uB978 \uC0AC\uB78C\uC5D0\uAC8C \uB3C4\uC6C0\uC774 \uB418\uC5C8\uC73C\uBA74 \uC88B\uACA0\uB2E4\uB294 \uB9C8\uC74C\uB3C4 \uC788\uB294\uB370, \uC774 \uB9C8\uC74C\uC740 \uC0C1\uB300\uBC29\uC5D0\uAC8C \uC798 \uBCF4\uC600\uC73C\uBA74 \uC88B\uACA0\uB2E4\uB294 \uAE30\uBCF8\uC801\uC778 \uC695\uAD6C\uAC00 \uC788\uB294 \uAC83\uC77C \uC218\uB3C4 \uC788\uACA0\uB2E4. \uD3B8\uC548\uD788 \uAE00\uC744 \uC4F0\uACE0 \uC2F6\uC744 \uBFD0\uC778\uB370, \uB610 \uB0A8\uB4E4\uC5D0\uAC8C \uBCF4\uC5EC\uC918\uC57C\uD558\uB294 \uC0C1\uD669\uC774 \uB418\uB2C8, \uC2E0\uACBD\uC744 \uB9CE\uC774 \uC368\uC57C\uD558\uB294 \uBD80\uBD84\uC774 \uBD80\uB2F4\uC2A4\uB7FD\uAE30\uB3C4 \uD55C \uAC83\uC774\uB2E4. \uC774\uAC83\uB3C4 \uBB50 \uC695\uC2EC\uC774\uB77C\uACE0 \uBCFC \uC218 \uC788\uB294 \uAC83 \uC544\uB2D0\uAE4C. \uB0B4 \uB2A5\uB825\uC5D0 \uBE44\uD574, \uB0A8\uB4E4\uC5D0\uAC8C \uC798 \uD558\uACE0 \uC788\uB2E4\uB294 \uAC83\uC744 \uBCF4\uC5EC\uC918\uC57C\uD558\uB2C8, \uC2E0\uACBD\uC740 \uC4F0\uC9C0 \uC54A\uC744 \uC218 \uC5C6\uACE0, \uADF8 \uC2E0\uACBD\uC740 \uC4F0\uB294 \uAC83\uC740 \uBD80\uB2F4\uC2A4\uB7FD\uAC8C \uB290\uB07C\uB2C8 \uB9D0\uC774\uB2E4."), mdx("p", null, "\uB0B4 \uAE00\uC744 \uBA87 \uBA85\uC774\uB098 \uC77D\uC744 \uAC83\uC774\uBA70, \uB0B4\uAC00 \uB0A8\uC5D0\uAC8C \uC798 \uBCF4\uC5EC\uC11C \uBB34\uC5C7\uD558\uB7B4. \uADF8\uB0E5 \uB098\uC758 \uC788\uB294 \uADF8\uB300\uB85C\uC758 \uBAA8\uC2B5\uC744 \uBCF4\uC5EC\uC8FC\uBA74 \uB418\uC9C0 \uC54A\uC744\uAE4C? \uB09C \uADF8\uB9AC \uC798\uB09C \uC0AC\uB78C\uB3C4 \uC544\uB2C8\uACE0, \uB9CE\uC774 \uBD80\uC871\uD55C \uC0AC\uB78C\uC774\uB2E4. \uADF8\uB798\uB3C4 \uC0B6\uC740 \uC798 \uC0B4\uC544\uAC00\uB824\uACE0 \uD558\uB8E8\uD558\uB8E8 \uB178\uB825\uD558\uB294 \uC0AC\uB78C\uC774\uB2E4. \uADF8 \uC815\uB3C4\uB9CC \uBCF4\uC5EC\uC918\uB3C4 \uB418\uC9C0 \uC54A\uC744\uAE4C."));
